import React, { Component } from 'react'
//import background from './mountain.png';
//import logo from './logo.jpg';


const divStyle = {
  display: 'inline'
}

class Welcome extends Component {
  constructor (props){
    super(props);
    this.state={
      imageURL: "./logo.jpg",
      backURL: "./mountain.png"
     }
  }
  render () {
    return (
      <div>
      <header>
      <div style ={divStyle}>
        <img src={this.state.imageURL} className="logo" />
      </div>
      </header>
    <div className="container">
      <img  src={this.state.backURL} className="img"/>
      <h1 className="center">WELCOME TO THE BANK OF THE SUN</h1>
    </div>
      </div>

    );

  }
}

export default Welcome;
